import React from 'react';
import { formateDate, formateNum } from '../../../functions/functions';
import CardUI from '../Card/CardUI';
import CardsUI from "../ui/CardsUI";

const CardsContainer = ({data, city}) => {

    const cards = data.map( (el, i) => <CardUI 
        key={i} 
        temp={formateNum(el.temp)} 
        date={formateDate(el.datetime)} 
        description={el.weather.description}
        icon={`https://www.weatherbit.io/static/img/icons/${el.weather.icon}.png`}
        pres={el.pres/1.333}
        humidity={el.rh}
        clouds={el.clouds}
        wind={el.wind_spd}
        direction={el.wind_cdir}/>)

    return <CardsUI city={city} cards={cards}/>
}

export default CardsContainer
